import React from 'react';

import { ProductList } from './styles';

export default function Home() {
  return (
    <ProductList>
      <li>
        <img
          src="https://w0.pngwave.com/png/639/972/coffee-cup-cafe-cappuccino-coffee-png-clip-art-thumbnail.png"
          alt="capuccino"
        />
      </li>
    </ProductList>
  );
}
